#include<iostream>
#include<bits/stdc++.h>
using namespace std;

void sieveOfEratosthenes(int n, vector<int>& primes){
    for(int i = 2; i*i <= n; i++){ //i*i was done to optimise even further
        if(primes[i]){
            for(int j = i*i; j <= n; j += i){ //i*i was done to optimise even further
                primes[j] = 0;
            }
        }
    }
}

int main()
{
    int n;
    cin>>n;

    vector<int> primes(n+1, 1);

    sieveOfEratosthenes(n, primes);

    for(int i = 2; i <= n; i++){
        if(primes[i]){
            cout<<i<<" ";
        }
    }
    cout<<endl;
}

